from typing import List

class Solution:
    def trap(self, height: List[int]) -> int:
        # This is like a prefix-sum technique.
        # Find the maximum value to the left of each point. And find the maximum
        # value to the right of each point. Then the current point will trap
        # min(maxLeft, maxRight) - height[i] amount of water. If this value is
        # negative, then it traps 0 amount of water.
        # Time Complexity: O(N) => we iterate through the list three times
        # Space Complexity: O(N) => we store max values in two arrays
        N = len(height)
        maxLeft = [0 for _ in range(N)]
        maxRight = [0 for _ in range(N)]
        max_so_far = 0
        for i in range(1, N):
            max_so_far = max(max_so_far, height[i-1])
            maxLeft[i] = max_so_far
        #print(maxLeft)
        max_so_far = 0
        for i in range(N-2, -1, -1):
            max_so_far = max(max_so_far, height[i+1])
            maxRight[i] = max_so_far
        #print(maxRight)
        res = 0
        for i in range(1, N-1):
            curr = min(maxLeft[i], maxRight[i]) - height[i]
            res += 0 if curr < 0 else curr
            #print(f'\ti, curr, res = {i}, {curr}, {res}')
        return res

